 // ProfilePage.js
import React from 'react';

function ProfilePage({ profile }) {
  if (!profile) {
    return <div>No profile information available.</div>;
  }

  return (
    <div>
      <h1>Profile Page</h1>
      <p>Name: {profile.name}</p>
      <p>Email: {profile.email}</p>
      {/* Add other profile fields here */}
    </div>
  );
}

export default ProfilePage;
